import React from "react";
import '../Css/login.css';
import img5 from '../image/img2.png';
import {NavLink} from 'react-router-dom';

const Login = () => {
    return (
      <>
      <div  className="main">
          <div className="col-lg-6  col-md-6 div1"><img src={img5} alt="loginpic"/>
           <NavLink to="/signup">Create a Account</NavLink>
             </div>
           <div className="col-lg-6 col-md-6 div2">
             <h2>Login In</h2>
             <form>
               <div>
                 <label htmlFor="Email">Email</label>
                  <input type="email" name="email" id="email" autoComplete="off" placeholder="Email"/>
               </div>
               <div>
                 <label htmlFor="password">Password</label>
                  <input type="password" name="password" id="password" autoComplete="off" placeholder="Password"/>
               </div>
             </form>
             <button type="button" class="btn btn-outline-primary|secondary|success|danger|warning|info|light|dark|link"></button>
             
           </div>
        </div>

      
      
      </>
    );
  }
  
  export default Login;
